import React from 'react';
import Main_Section from './components/Main_Section';

function About() {
  const data = {
    nameData : "About grocery store",
  };
  // const {myName} =useProductContext();
  const para = {
    paraData : "The best online grocery store in India. bigbasket is an online supermarket for all your daily needs. Online shopping now made easy with a wide range of",
  };
  const image = {
    imageData : "./images/main_section_image.jpg",
  }
  return (
   <>
     {/* {myName} */}
   <Main_Section myData ={data} para={para} image={image}/>
   </>
  )
}

export default About;
